import React, { useState, ChangeEvent } from 'react';

interface ThriveIntakeFormData {
  intakeDate: string;
  navigatorName: string;
  programType: {
    ORIA: boolean;
    EMM: boolean;
    InternalReferral: boolean;
    ORIAOptions: string[]; // Sub-options for ORIA
    InternalReferralOptions: string[]; // Sub-options for Internal Referral
  };
  firstName: string;
  lastName: string;
  dateOfBirth: string;
  gender: string;
  countryOfOrigin: string;
  phoneNumber: string;
  emailAddress: string;
  address: string;
  immigrationStatus: string;
  alienNumber: string;
  eligibilityDate: string;
  programEligibility: {
    receivingServices: boolean;
    ageOver16: boolean;
    livesInWashington: boolean;
    arrivedAfterJuly2021: boolean;
    approvedImmigrationStatus: boolean;
    consentFormCompleted: boolean;
    releaseFormCompleted: boolean;
    immigrationStatusCopy: boolean;
  };
  servicesNeeded: string[];
}

const ThriveIntakeForm: React.FC = () => {
  const [formData, setFormData] = useState<ThriveIntakeFormData>({
    intakeDate: '',
    navigatorName: '',
    programType: {
      ORIA: false,
      EMM: false,
      InternalReferral: false,
      ORIAOptions: [],
      InternalReferralOptions: [],
    },
    firstName: '',
    lastName: '',
    dateOfBirth: '',
    gender: '',
    countryOfOrigin: '',
    phoneNumber: '',
    emailAddress: '',
    address: '',
    immigrationStatus: '',
    alienNumber: '',
    eligibilityDate: '',
    programEligibility: {
      receivingServices: false,
      ageOver16: false,
      livesInWashington: false,
      arrivedAfterJuly2021: false,
      approvedImmigrationStatus: false,
      consentFormCompleted: false,
      releaseFormCompleted: false,
      immigrationStatusCopy: false,
    },
    servicesNeeded: [],
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
    const { name, value, type, checked } = e.target as HTMLInputElement;

    if (type === 'checkbox') {
      if (name.startsWith('programType.')) {
        const field = name.split('.')[1]; // Extract the field name (e.g., ORIA, EMM, etc.)
        setFormData((prev) => ({
          ...prev,
          programType: {
            ...prev.programType,
            [field]: checked,
          },
        }));
      } else if (name.startsWith('ORIAOptions.')) {
        const option = name.split('.')[1]; // Extract the ORIA option (e.g., Affordable Housing)
        setFormData((prev) => ({
          ...prev,
          programType: {
            ...prev.programType,
            ORIAOptions: checked
              ? [...prev.programType.ORIAOptions, option]
              : prev.programType.ORIAOptions.filter((item) => item !== option),
          },
        }));
      } else if (name.startsWith('InternalReferralOptions.')) {
        const option = name.split('.')[1]; // Extract the Internal Referral option (e.g., Economic Empowerment)
        setFormData((prev) => ({
          ...prev,
          programType: {
            ...prev.programType,
            InternalReferralOptions: checked
              ? [...prev.programType.InternalReferralOptions, option]
              : prev.programType.InternalReferralOptions.filter((item) => item !== option),
          },
        }));
      } else if (name === 'servicesNeeded') {
        setFormData((prev) => ({
          ...prev,
          servicesNeeded: checked
            ? [...prev.servicesNeeded, value]
            : prev.servicesNeeded.filter((item) => item !== value),
        }));
      } else {
        setFormData((prev) => ({
          ...prev,
          programEligibility: {
            ...prev.programEligibility,
            [name]: checked,
          },
        }));
      }
    } else {
      setFormData((prev) => ({
        ...prev,
        [name]: value,
      }));
    }
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Thrive Intake Form Data:', formData);
  };

  return (
    <div className="max-w-4xl mx-auto p-6 bg-white shadow-lg rounded-lg">
      <h1 className="text-3xl font-bold text-center mb-6">
        Thrive International Intake/Registration Form
      </h1>
      <form onSubmit={handleSubmit} className="space-y-6">
        {/* Intake Date and Navigator Name */}
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div>
            <label className="block text-sm font-medium text-gray-700">
              Intake Date
            </label>
            <input
              type="date"
              name="intakeDate"
              value={formData.intakeDate}
              onChange={handleChange}
              className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              required
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">
              Navigator Name
            </label>
            <input
              type="text"
              name="navigatorName"
              value={formData.navigatorName}
              onChange={handleChange}
              className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              required
            />
          </div>
        </div>

        {/* Program Type */}
        <div className="space-y-4">
          <label className="block text-sm font-medium text-gray-700">
            Program Type
          </label>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programType.ORIA"
                checked={formData.programType.ORIA}
                onChange={handleChange}
                className="mr-2"
              />
              ORIA
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programType.EMM"
                checked={formData.programType.EMM}
                onChange={handleChange}
                className="mr-2"
              />
              EMM
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programType.InternalReferral"
                checked={formData.programType.InternalReferral}
                onChange={handleChange}
                className="mr-2"
              />
              Internal Referral
            </label>
          </div>

          {/* ORIA Sub-Options */}
          {formData.programType.ORIA && (
            <div className="ml-6 space-y-2">
              <label className="block text-sm font-medium text-gray-700">
                ORIA Options
              </label>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                {['Affordable Housing', 'Teen & Kid Closet', 'Medical', 'Other'].map((option) => (
                  <label key={option} className="flex items-center">
                    <input
                      type="checkbox"
                      name={`ORIAOptions.${option}`}
                      checked={formData.programType.ORIAOptions.includes(option)}
                      onChange={handleChange}
                      className="mr-2"
                    />
                    {option}
                  </label>
                ))}
              </div>
            </div>
          )}

          {/* Internal Referral Sub-Options */}
          {formData.programType.InternalReferral && (
            <div className="ml-6 space-y-2">
              <label className="block text-sm font-medium text-gray-700">
                Internal Referral Options
              </label>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                {['Economic Empowerment', 'Women\'s Empowerment', 'Youth Empowerment'].map((option) => (
                  <label key={option} className="flex items-center">
                    <input
                      type="checkbox"
                      name={`InternalReferralOptions.${option}`}
                      checked={formData.programType.InternalReferralOptions.includes(option)}
                      onChange={handleChange}
                      className="mr-2"
                    />
                    {option}
                  </label>
                ))}
              </div>
            </div>
          )}
        </div>

        {/* Participant Information */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Participant Information</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div>
              <label className="block text-sm font-medium text-gray-700">
                First Name
              </label>
              <input
                type="text"
                name="firstName"
                value={formData.firstName}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Last Name
              </label>
              <input
                type="text"
                name="lastName"
                value={formData.lastName}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Date of Birth
              </label>
              <input
                type="date"
                name="dateOfBirth"
                value={formData.dateOfBirth}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Gender
              </label>
              <input
                type="text"
                name="gender"
                value={formData.gender}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Country of Origin
              </label>
              <input
                type="text"
                name="countryOfOrigin"
                value={formData.countryOfOrigin}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Phone Number
              </label>
              <input
                type="tel"
                name="phoneNumber"
                value={formData.phoneNumber}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Email Address
              </label>
              <input
                type="email"
                name="emailAddress"
                value={formData.emailAddress}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Address
              </label>
              <input
                type="text"
                name="address"
                value={formData.address}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
          </div>
        </div>

        {/* Current Immigration Status */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Current Immigration Status</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Immigration Status
              </label>
              <select
                name="immigrationStatus"
                value={formData.immigrationStatus}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              >
                <option value="">Select Status</option>
                <option value="Refugee">Refugee</option>
                <option value="Asylum">Asylum (Approved and granted)</option>
                <option value="Cuban and Haitian entrants">Cuban and Haitian entrants</option>
                <option value="Amerasians">Amerasians</option>
                <option value="Certified victims of human trafficking">Certified victims of human trafficking</option>
                <option value="Iraqi and Afghan Special Immigrants">Iraqi and Afghan Special Immigrants</option>
                <option value="Afghan Humanitarian Parolees">Afghan Humanitarian Parolees</option>
                <option value="Afghans with Special Immigrant Parole (SI/SQ Parole) or Special Immigrant Conditional Permanent Residents (SI CPR)">
                  Afghans with Special Immigrant Parole (SI/SQ Parole) or Special Immigrant Conditional Permanent Residents (SI CPR)
                </option>
                <option value="Ukrainian Humanitarian Parolees">Ukrainian Humanitarian Parolees</option>
              </select>
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Alien Number
              </label>
              <input
                type="text"
                name="alienNumber"
                value={formData.alienNumber}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Eligibility Date
              </label>
              <input
                type="date"
                name="eligibilityDate"
                value={formData.eligibilityDate}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              />
            </div>
          </div>
        </div>

        {/* Program Eligibility Determination */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Program Eligibility Determination (DSHS ONLY)</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <label className="flex items-center">
              <input
                type="checkbox"
                name="receivingServices"
                checked={formData.programEligibility.receivingServices}
                onChange={handleChange}
                className="mr-2"
              />
              Is the participant receiving services from resettlement agencies, such as Reception and Placement, Matching Grant, and/or Preferred Community Programs?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="ageOver16"
                checked={formData.programEligibility.ageOver16}
                onChange={handleChange}
                className="mr-2"
              />
              Is the participant 16 years of age or older?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="livesInWashington"
                checked={formData.programEligibility.livesInWashington}
                onChange={handleChange}
                className="mr-2"
              />
              Does the participant live in Washington?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="arrivedAfterJuly2021"
                checked={formData.programEligibility.arrivedAfterJuly2021}
                onChange={handleChange}
                className="mr-2"
              />
              Did the participant arrive in the United States on or after July 1, 2021?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="approvedImmigrationStatus"
                checked={formData.programEligibility.approvedImmigrationStatus}
                onChange={handleChange}
                className="mr-2"
              />
              Does the participant have an approved immigration status?
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="consentFormCompleted"
                checked={formData.programEligibility.consentFormCompleted}
                onChange={handleChange}
                className="mr-2"
              />
              Completed Consent Form
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="releaseFormCompleted"
                checked={formData.programEligibility.releaseFormCompleted}
                onChange={handleChange}
                className="mr-2"
              />
              Completed Release of Information (Thrive and DSHS)
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="immigrationStatusCopy"
                checked={formData.programEligibility.immigrationStatusCopy}
                onChange={handleChange}
                className="mr-2"
              />
              Is a copy of the immigration status collected and kept in the participant's file?
            </label>
          </div>
        </div>

        {/* Services Needed */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">What Services is Participant in Need Of?</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <label className="flex items-center">
              <input
                type="checkbox"
                name="servicesNeeded"
                value="Housing"
                checked={formData.servicesNeeded.includes('Housing')}
                onChange={handleChange}
                className="mr-2"
              />
              Housing
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="servicesNeeded"
                value="Employment/Financials"
                checked={formData.servicesNeeded.includes('Employment/Financials')}
                onChange={handleChange}
                className="mr-2"
              />
              Employment/Financials
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="servicesNeeded"
                value="Medical"
                checked={formData.servicesNeeded.includes('Medical')}
                onChange={handleChange}
                className="mr-2"
              />
              Medical
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="servicesNeeded"
                value="Assistance Services"
                checked={formData.servicesNeeded.includes('Assistance Services')}
                onChange={handleChange}
                className="mr-2"
              />
              Assistance Services
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="servicesNeeded"
                value="Other"
                checked={formData.servicesNeeded.includes('Other')}
                onChange={handleChange}
                className="mr-2"
              />
              Other
            </label>
          </div>
        </div>

        {/* Submit Button */}
        <div className="flex justify-end">
          <button
            type="submit"
            className="bg-indigo-600 text-white px-6 py-2 rounded-md hover:bg-indigo-700 transition-colors"
          >
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default ThriveIntakeForm;
